import React from 'react';
import Logo1 from '../Images/MIS SERVICES REQUEST (Presentation (169)) (Logo) (500 × 200 px) (700 × 200 px) (1000 × 100 px) (700 × 100 px).png';
import Logo2 from '../Images/carsucc.png';
const Header = () => {
	return (
		<div className='header'>
			<div className='logo'>
				<h1 className='logocolor'>
        <img src={Logo2} alt='logo' width="200" height="200" /> </h1>MIS SERVICES REQUEST
				<h2 className='color2'></h2>
			</div>
		</div>
	);
};
export default Header;
